import React, { Component } from 'react'
import './SMaterialBlock.css'

export default class ItemBlock extends Component {
    state = {
        myemail: 'baba@baba.com',
        displayform: 'block',
    }
    render() {
        console.log('class email id ', this.props['data'])
        if (this.state.myemail === this.props['data']) {
            return (
                <span>
                    <img src="https://img.icons8.com/flat_round/50/000000/plus.png" alt = ""/>
                    <div className = 'study-entry-form' style = {{display: this.state.displayform}}>
                        <form>
                            <h2>Study material entry form: </h2>
                            <input type = "text"></input>
                            <input type = "text"></input>
                            <input type = "file"></input>
                            <input type = "file"></input>
                        </form>
                    </div>
                </span>
                
            )
        }
        else {
            return <p></p>
        }
    }
}
